create table Mate_In_N
(
    id            int auto_increment
        primary key,
    starting_fen  varchar(256) null,
    to_move       varchar(32)  null,
    moves_to_mate int          null,
    game_id       int          null,
    constraint Mate_In_N__Game_fk
        foreign key (game_id) references Game (Id)
);

